import React, {useEffect, useState} from "react";
import { useDispatch } from "react-redux";
import { postExample } from "../actions/exampleActions";

function PostPage() {
  const [title, setTitle] = useState("");
  const [body, setBody] = useState("");
  const [userId, setUserId] = useState(-1);
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(postExample(title, body, userId));
  }, []);
  return (
    <div>
      Post Page
      <input type="text" name="title" value={title} onChange={(e) => setTitle(e.target.value)}>Title</input>
      <input type="text" name="title" value={body} onChange={(e) => setBody(e.target.value)}>Body</input>
      <input type="text" name="title" value={userId} onChange={(e) => setUserId(e.target.value)}>UserId</input>
    </div>
  );
}

export default PostPage;
